import React from 'react';
import './LoginImage.css';
import loginImg from '../assets/placeholder1.jpg';

const LoginImage = () => (
  <div className="login-image-container">
    <img src={loginImg} alt="Furniture login visual" className="login-image" />
  </div>
);

export default LoginImage;
